import React, { useState, useEffect } from "react";
import UseTable from "./hooks/useTable";
function popular() {
    const [cards, setCards] = useState()
    useEffect(() => {
        axios
            .get('http://localhost:3001/recipesPopular')
            .then(res => {
                console.log(res)
                setCards(res.data)
            })
            .catch(err => {
                console.log(err)
            })
    }, [])
    return (
        <UseTable data={cards} />
    )
}
export default popular







